import React from "react";
import { Data } from "./Data";
import Header from "./Header";
impo

const Store = () => {
  console.log(Data);
  return (
    <>
    <Header/>
    <div className="d-flex justify-content-around align-items-center container storeNav">
      <div className="list">Timeless Romance</div>
      <div className="list">Celestial Couture</div>
      <div className="list">Celestial Couture</div>
    </div>
      <div className="container-fluid">
        {Data.map((file, index) => (
          <div className="d-flex" key={index}>
            {
            <>
            <img src={file.url} alt="" />
            <h5 className="card-title">{file.text}</h5>
            </>
            }
            
          </div>
        ))}
      </div>
    </>
  );
};
export default Store;
